  border: var(--bw-green-border);
}
.success:before {
    content:"\f19f";
    border:var(--bw-green-border);
}
.success a{
    color: var(--bw-dark-green);
}
.success a:after{
    background: var(--bw-dark-green);
}
.global{
    width: 100%;
}
.text-only{
    line-height: 1.6em;
}
.text-only p{
