.tooltip{
    cursor: pointer;
  border-top-left-radius: 0px !important;
}
/* Tooltip text */
.tooltip .tooltiptext {
        visibility: hidden;
    max-width: 300px;
    background-color: #fff;
    color: inherit;
    padding: 10px 15px;
    border-radius: 3px;
    border: var(--bw-border);
    box-shadow: var(--shadow);
    margin-left: var(--m);
    /* Position the tooltip text - see examples below! */
    position: absolute;
    z-index: 1;
    margin-top: -10px;
}
.tooltiptext {
    position: relative;
    border: var(--bw-border);
}
.tooltiptext:after, .tooltiptext:before {
    right: 100%;
    top: 20px;
    border: solid transparent;
    content: " ";
    height: 0;
    width: 0;
    position: absolute;
    pointer-events: none;
}

